import React ,{ useEffect , useState }from 'react';
import {Navbar , Nav ,NavItem, NavbarBrand} from 'reactstrap';
import { Button, Form, FormGroup, Label, Input, FormText } from 'reactstrap';
import Food from './Food';
import { BrowserRouter as Router ,Switch, Route } from 'react-router-dom';



const  Navibar =  () => {
    const [recipies,setRecipies] = useState([]);
    const [search , setsearch] = useState('');

    useEffect( () => {
      getRecipies();
    } , []);

    const getRecipies = async () => {
      const response = await fetch(
        "https://api.spoonacula.com/recipes/complexSearch?apiKey=50a92691d65344388c28929af9bf0ac6&query=" + "chicken" +"&number=10"
      );
      const data = await response.json();
      setRecipies(data.results);
      console.log(data)
    }

        return(
            <div className = "Navibar">
                <div>
                    <Navbar dark color = "primary">
                        <div className= "container">
                            <NavbarBrand href = "/">
                                Recipie
                            </NavbarBrand> 
                            <Nav className="mr-auto" navbar>
                                <NavItem>
                                    <Form className = "search-form">
                                        <Input type="text" className = "search-bar" name="recipie" value = "search" placeholder="search for recipie" />
                                    </Form>
                                </NavItem>
                                <NavItem>
                                    <button className = "search-button" type = "submit">
                                    Search
                                    </button>
                                </NavItem>
                            </Nav>
                        </div>
                    </Navbar>
                </div>
                    {recipies.map(results => (
                    <Food title = {results.title} image = {results.image} />
                    ))}

            </div>


        )
}
export default Navibar;
